import React from 'react';

export const sortData = (res) => {
  let sortedData = [...res];
  sortedData.sort((a, b) => {
    if (a.cases > b.cases) {
      return -1;
    } else {
      return 1;
    }
  });
  return sortedData;
};

export default Sort;
